import React, { useState, useEffect } from "react";
import axios from "axios";
import './App.css';

function App() {

  let [ posts, setPosts ] = useState([{
    "author": "--",
    "title": "--",
    "descripcion": "--",
    "url": "--",
    "date": "--",
    "content": "--"
}]);
  useEffect(() => {
    async function getResults() {
      let formData = new FormData();
      formData.append("q", "statistics");
      formData.append("q", "statistics");
      const results = await axios({
        url: "https://newsapi.org/v2/everything?q=statistics&apiKey=e52e187dd3c848ff9aa0da5f007a8590",
        method: 'get',
        dataType: 'json',
        ContentType: 'application/json',
    });
      setPosts(results.articles)
      console.log(results.articles)
    }
    getResults()
  },[])
  console.log(posts)

  return (
    <div className="App">
      <table>
        <tr>
          <th>Autor</th>
          <th>Titulo</th>
          <th>Descripcion</th>
          <th>URL</th>
          <th>Fecha</th>
          <th>Contenido</th>
        </tr>
        {posts.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.author}</td>
              <td>{val.title}</td>
              <td>{val.description}</td>
              <td>{val.url}</td>
              <td>{val.publishedAt}</td>
              <td>{val.content}</td>
            </tr>
          )
        })}
      </table>
    </div>

  );
}

export default App;
